import React from 'react';
import Image from "./blogging.svg";

const Home =() => {
	return ( 
		<>
  <section id="header" className="d-flex align-items-center">
    <div className="container-fluid nav_bg">
  <div className="row">
    <div className="col-10 mx-auto my-5">
    
    <div className="row">
    
    <div className="col-md-6 order-1 order-lg-1 text-white d-flex justify-content-center">
    <h1 className="">Feel free to connect with <strong className="brand-name">Audonix</strong></h1><br />
    <p className="">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
    <button type="button" className="btn btn-outline-light rounded-pill">Get started</button>
    </div>
    
    <div className="col-md-6 order-2 order-lg-2"><img src={Image} className="img-fluid" alt="" alt="home img" />
    </div>
   
    
    </div>

    </div>
  
  </div>
</div>
 </section>


		
		
			
		</>
		);
};

export default Home;
